function create() {

    for(let i = 0; i < moves.length; i++)
        {
            qVector.push(new QLine(boardStates[i], moves[i], qVals[i]));
        }
    //mouse coords
    /*
    let coordText = this.add.text(10, 10, 'X: 0, Y: 0', {
        fontSize: '20px',
        fill: '#ffffff',
    });

    this.input.on('pointermove', (pointer) => {
        coordText.setText(`X: ${pointer.x}, Y: ${pointer.y}`);
    });
    */
    this.myBoard = new TTTBoard();
    
    this.add.image(300, 300, 'grid');

    const rows = 3;
    const cols = 3;
    const zoneWidth = 200;
    const zoneHeight = 200;
    const startX = 100;
    const startY = 100;
    const spacing = 200;

    for (let row = 0; row < rows; row++) {
        for (let col = 0; col < cols; col++) {
            let x = startX + col * spacing;
            let y = startY + row * spacing;

            let zone = this.add.zone(x, y, zoneWidth, zoneHeight)
                .setInteractive()
                .on('pointerdown', () => {
                    
                    //console.log(`Zone at row ${row + 1}, col ${col + 1} clicked!`);
                    isClicked = true;
                    playerChoice = row*3+col;
                    //clickText.setText('Zone ' + playerChoice + ' Clicked!');
                });               
                
            clickableSpaces.push(zone);        
            
        }
    }

    


    
    // Add text to indicate instructions or feedback
    //clickText = this.add.text(300, 200, 'Click the green box!', {
    //    fontSize: '20px',
    //    fill: '#ffffff',
    //});
    // Add text to indicate instructions or feedback
    turnText = this.add.text(10, 10, 'TurnText', {
        fontSize: '20px',
        fill: '#ffffff',
    });

    //extraText = this.add.text(300, 350, 'extext', {
    //    fontSize: '20px',
    //    fill: '#ffffff',
    //});
}

function update() {
    if (gameStatus == 1)
        {
        if(xTurn)
        {
            turnText.setText('x turn');
            if (isClicked && !this.myBoard.isOccupied(playerChoice))
            {
                this.myBoard.bools[playerChoice] = true;
                this.myBoard.bools[playerChoice+9] = true;
                xTurn = false;
                isClicked = false;
                if(this.myBoard.isWinner(true))
                {
                    turnText.setText('x wins');
                    gameStatus = 0;
                }
                if (this.myBoard.isDraw())
                    {
                        turnText.setText('it is a draw');
                            gameStatus = 0;
                    }
            }
        }        
        else
        {     
            turnText.setText('o turn');
            let selectedMove = Math.floor(Math.random() * 9);
            //pack booleans
            let packeduint = packBooleans(this.myBoard.bools);
            //look up in table
            let posMoves = [];
            for(let i = 0; i < moves.length; i++)
                {
                    if (qVector[i].uint32 == packeduint)
                    { posMoves.push(i); }
                }
            let bestQ = 0.0;
            let bestmove = 0;
            //extraText.setText('found!' + packeduint + ' ' + posMoves.length)
            for(let i = 0; i < posMoves.length; i++)
                {
                    if(qVals[posMoves[i]] > bestQ)
                    {
                        bestQ = qVals[posMoves[i]];
                        bestmove = moves[posMoves[i]];
                    }
                }
            if (bestQ > 0.01) { selectedMove = bestmove;}

            if (!this.myBoard.isOccupied(selectedMove))
            {
                this.myBoard.bools[selectedMove] = true;            
                this.myBoard.bools[selectedMove+9] = false; 
                xTurn = true;
                if(this.myBoard.isWinner(false))
                    {
                        turnText.setText('o wins');
                        gameStatus = 0;
                    }
                if (this.myBoard.isDraw())
                {
                    turnText.setText('it is a draw');
                        gameStatus = 0;
                }
            }
        }
    }
    else //if no game running reset game
    {
        if (isClicked)
        {
            console.log('reset');
            isClicked= false;
            xTurn= true;
            gameStatus = 1;
            this.myBoard.reset();
            turnText.setText('x turn');
        }
    }

    //console.log('gamestatus: ', gameStatus);

    //draw the stuff
    gamePieces.forEach(piece => piece.destroy()); //inefficient to destroy each frame but whatever

    const rows = 3;
    const cols = 3;
    const zoneWidth = 200;
    const zoneHeight = 200;
    const startX = 100;
    const startY = 100;
    const spacing = 200;

    for (let row = 0; row < 9; row++) {
        for (let col = 0; col < 9; col++) {
            let x = startX + col * spacing;
            let y = startY + row * spacing;

            if(this.myBoard.bools[row*3+col])
                {
                    if (this.myBoard.bools[row*3+col+9])
                    { let xImage = this.add.image(x, y, 'Xpic'); gamePieces.push(xImage);}
                    else { let oImage = this.add.image(x, y, 'Opic'); gamePieces.push(oImage);}
                    
                }
        }
    }


    

    // Example: Change background color over time (optional)
    //if (Math.random() > 0.99) {
    //    this.cameras.main.setBackgroundColor(Phaser.Display.Color.RandomRGB());
    //}

}

new Phaser.Game(config);
